import React, { useState } from "react";
import './css/Cirle.css';
const CirclePage = () => {
  const [showMore, setShowMore] = useState(false);

  const toggleShowMore = () => {
    setShowMore(!showMore);
  };

  return (
    <div>
      <h1>Hello, I'm Subarna Dahal</h1>
      <h2>I am a Tech Enthusiast</h2>
      <img src="path_to_your_image.jpg" alt="Subarna Dahal" />
      {showMore ? (
        <div>
          <h3>Skills</h3>
          <ul>
            <li>JavaScript</li>
            <li>React</li>
            <li>HTML</li>
            <li>CSS</li>
            <li>Nodejs</li>
            <li>Mongodb</li>
            <li>Mysql</li>
          </ul>
          <h3>Contact Me</h3>
          <p>Email: subarnadahal456@gmail.com</p>
          {/* Add social media links or other contact information */}
          <button onClick={toggleShowMore}>Show Less</button>
        </div>
      ) : (
        <div>
          <button onClick={toggleShowMore}>Read More</button>
        </div>
      )}
    </div>
  );
};

export default CirclePage;
